import Carousel from 'react-multi-carousel';
import { bannerData } from '../constant/data';

const Banner =() =>{
    return (
        <Carousel>
          <p>hello</p>
      responsive={responsive}
      {
        bannerData.map(data => (
            <img src ={data.url} alt="banner" />
        ))
      }
        </Carousel>    )
}
export default Banner;
